import '../styles/employeeReg.css';
import {SubmitHandler, useForm} from 'react-hook-form';
import { Link } from  'react-router-dom';

interface formData {
    employeeName: string;
    employeeEmail: string;
    agreeTerms: boolean;
};

/* Employee registration form */
const EmployeeReg = () => {
    const { register, handleSubmit, formState: { errors } } = useForm<formData>();

    const onSubmit: SubmitHandler<formData> = (data) => {
        console.log(data);
    };

    return (
        <div className="employeereg-container">
            <div className="border rounder p-3 mx-auto bg-light employeeinnerreg-container">
                <div className="margin-custom">
                    <Link to='/'>
                        <img src="images/abovoLogo.svg" alt="Abovo logo" id="abovoLogo" />
                    </Link>
                </div>

                <h1 className="preregistration-form-title" > Álláskeresőknek </h1>

                <form onSubmit={handleSubmit(onSubmit)}>

                    <div className="form-group">
                        <label htmlFor="employeeName"> Hogyan szólíthatunk? </label>
                        <input
                            type="text"
                            id="employeeName"
                            {...register("employeeName", { required: "A munkaltató neve kötelező." })}
                            className={`form-control ${errors.employeeName ? 'is-invalid' : ''}`}                          
                        />
                        {errors.employeeName && <div className="invalid-feedback">{errors.employeeName.message as string}</div>}
                    </div>

                    <div className="form-group">
                        <label htmlFor="employeeEmail"> E-mail cím </label>
                            <input
                                type="email"
                                id="employeeEmail"
                                {...register("employeeEmail", {required: "E-mail cím kötelező."})}
                                className={`form-control ${errors.employeeEmail ? 'is-invalid' : ''}`}
                            />
                        {errors.employeeEmail && <div className="invalid-feedback">{errors.employeeEmail.message as string}</div>}
                    </div>

                    <div className="form-group">
                        <label htmlFor="employeeEmail"> Elfogadom a felhasznaloi felteteleket </label>
                            <input
                                type="checkbox"
                                id="agreeTerms"
                                {...register("agreeTerms", {required: "E-mail cím kötelező."})}
                                className={`form-control ${errors.agreeTerms ? 'is-invalid' : ''}`}
                            />
                        {errors.employeeEmail && <div className="invalid-feedback">{errors.employeeEmail.message as string}</div>}
                    </div>

                    <div className="form-group">
                        <label htmlFor="employeeEmail"> Elfogadom az adatvédelmi és adatkezelési szabályzatot </label>
                            <input
                                type="checkbox"
                                id="agreeTerms"
                                {...register("agreeTerms", {required: "E-mail cím kötelező."})}
                                className={`form-control ${errors.agreeTerms ? 'is-invalid' : ''}`}
                            />
                        {errors.employeeEmail && <div className="invalid-feedback">{errors.employeeEmail.message as string}</div>}
                    </div>

                    <div className="form-group">
                        <label htmlFor="employeeEmail"> Feliratkozok a hírlevélre </label>
                            <input
                                type="checkbox"
                                id="agreeTerms"
                                {...register("agreeTerms", {required: "E-mail cím kötelező."})}
                                className={`form-control ${errors.agreeTerms ? 'is-invalid' : ''}`}
                            />
                        {errors.employeeEmail && <div className="invalid-feedback">{errors.employeeEmail.message as string}</div>}
                    </div>

                    <button type="submit" className="btn btn-primary">Register</button>
                </form>
            </div>
        </div>
    )
};

export default EmployeeReg;
